import React from 'react';
import { formatDateToBR } from '../services/utils';

const PersonCard = ({ person, onEdit, onDelete }) => {
  return (
    <div className="person-card">
      <h3>{person.name}</h3>
      <p>Email: {person.email}</p>
      <p>Data de Nascimento: {formatDateToBR(person.birthdate)}</p>
      <button onClick={() => onEdit(person)}>Editar</button>
      <button onClick={() => onDelete(person.id)}>Excluir</button>
    </div>
  );
};

export default PersonCard;
